  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Nine-pipe
  and Pablo National Wildlife Refuge outlines Refuge accomplishments during the 1996
  calendar year. The report begins with a summary of the year's highlights and weather
  conditions. Land acquisition is covered. The report includes a planning section
  which discusses the management plan, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel and volunteer programs is given. Habitat management
  is also covered; subjects include wetlands, croplands, grasslands, grazing, and
  pest control. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, and fisheries resources. The public uses of the Refuge described in
  this report include outdoor classrooms, interpretive programs, hunting, fishing,
  wildlife observation, outdoor recreation, and law enforcement. The equipment and
  facilities section of the report provides information about rehabilitation. Cooperative
  programs are provided at the end. Refuge brochures are attached.\",\n\t\"owner_org\":
